class TableJSONParser:
    def __init__(self):
        self.__audio_links_dict = dict()
        for sermon_data in raw_audio_links_list:
            if 'id' in sermon_data and 'link' in sermon_data:
                id = sermon_data["id"]
                link = sermon_data["link"]
                key = id.replace("RUS", "").strip().lower()
                self.__audio_links_dict[key] = link

    @staticmethod
    def __get_investigate_object_from_data_items(data_items: list) -> dict:
        investigate_object = dict()

        for paragraph in data_items:
            for key in paragraph.keys():
                if key not in investigate_object:
                    investigate_object[key] = dict()
                if paragraph[key] not in investigate_object[key]:
                    investigate_object[key][paragraph[key]] = []
                investigate_object[key][paragraph[key]].append(paragraph)

        return investigate_object

    @staticmethod
    def __get_data_items_from_file(file_path: str) -> list:
        with open(file_path, 'r') as file:
            return json.load(file)

    @staticmethod
    def __get_sermons_raw_data(file_path: str) -> list:
        data_items = TableJSONParser.__get_data_items_from_file(file_path)

        sermons = dict()

        def check_sermon_record(sermon_id: str):
            if sermon_id not in sermons:
                sermons[sermon_id] = {
                    'paragraphs': []
                }

        for data_item in data_items:
            level = data_item['level']

            if level == 'sermon':
                sermon_id = data_item['recordId']
                check_sermon_record(sermon_id)
                sermons[sermon_id]['title'] = data_item['title']
                sermons[sermon_id]['identification'] = data_item['productId']
            elif level == 'normal':
                sermon_id = data_item['parentPath'].replace('/', '')
                check_sermon_record(sermon_id)
                sermons[sermon_id]['paragraphs'].append(data_item['html'])

        return list(sermons.values())

    def __get_sermons_data(self) -> list:
        sermons = TableJSONParser.__get_sermons_raw_data('/Users/slava/files/SOG2/SOG2_src/backend/import/rus.json')
        example_paragraph = sermons[12]['paragraphs'][1]

        return [{
            "translation": "VGR",
            "name": sermon['title'],
            "date": '2025-01-07T23:29:10.706Z',
            "content": sermon['paragraphs'],
            "audio_link": self.__audio_links_dict.get(sermon["identification"].lower()),
        } for sermon in sermons]

    @staticmethod
    def __get_paragraphs_from_content(sermon_data_content: [str]):
        result = []
        order = 0
        chapter = 1

        for content in sermon_data_content:
            soup = BeautifulSoup(content, 'html.parser')

            paragraphs = soup.find_all('p')

            for paragraph in paragraphs:
                spans = paragraph.find_all('span', class_='st')

                for span in spans:
                    new_chapter_span = span.find('span', class_='pn')
                    if new_chapter_span:
                        chapter = int(new_chapter_span.get_text(strip=True))

                    result.append({
                        "ms": span.get("ms"),
                        "content": ''.join(span.find_all(text=True, recursive=False)).strip(),
                        "chapter": chapter,
                        "paragraph_order": order,
                    })

                    order += 1

        return result

    def parse(self, delete_previous=False):
        branham_sermons_data = self.__get_sermons_data()

        with Session(engine) as session:
            if delete_previous:
                all_records = session.query(Sermon).all()
                for record in all_records:
                    session.delete(record)
                session.commit()
            for sermon in branham_sermons_data:
                sermon_obj = Sermon(
                    translation=sermon["translation"],
                    language='rus',
                    name=sermon["name"],
                    date=datetime.fromisoformat(sermon["date"]),
                    paragraphs=[],
                    audio_mappings=([SermonAudioMapping(audio_link=sermon["audio_link"])]
                                    if sermon.get("audio_link") else [])
                )
                session.add(sermon_obj)
                session.commit()

                paragraphs_objects = [
                    Paragraph(
                        sermon_id=sermon_obj.id,
                        paragraph_order=paragraph["paragraph_order"],
                        chapter=paragraph["chapter"],
                        content=paragraph["content"],
                        slide_audio_mappings=(
                            [SlideAudioMapping(
                                slide_collection_audio_mapping_id=sermon_obj.audio_mappings[0].id,
                                time_point=int(int(paragraph["ms"]) / 1000),
                            )]
                            if (len(sermon_obj.audio_mappings) and paragraph.get("ms")) else []
                        )
                    ) for paragraph in TableJSONParser.__get_paragraphs_from_content(sermon["content"])
                ]

                session.add_all(paragraphs_objects)
                session.commit()

        return True



